#mudroom renovation!!! Finally dialed in the room we walk through every day.  It’s amazing what kind of junk you stop noticing just because it’s there all the time.  And it really is incredible how different you can feel by putting conscious time, energy, and creativity into a space in your home.  Grateful for these little bits of “spiritual technology” like #fengshui (via @soulsmirror) which offer a structure for focused intention - which, if you believe in it… is kinda’ magic.

